    public CalcType CalculatorType
    {
        get { return ViewState["CalculatorType"] == null ? CalcType.Refinance : (CalcType)ViewState["CalculatorType"]; }
        set { ViewState["CalculatorType"] = value; }
    }

    private decimal Pwoc { get; set; }

    protected void Page_Load(object sender, EventArgs e)
    {
        switch (CalculatorType)
        {
            case CalcType.Refinance:
                CalculatorTitleLiteral.Text = "Refinance";
				NewLoanAmountRequiredFieldValidator.ValidationGroup="RefinanceGroup";
				CalculateButton.ValidationGroup="RefinanceGroup";
				NewLoanAmountCompareValidator.ValidationGroup="RefinanceGroup";
                break;
            case CalcType.HomeEquityLoan:
                CalculatorTitleLiteral.Text = "Home Equity Loan";
				NewLoanAmountRequiredFieldValidator.ValidationGroup="HomeEquityLoanGroup";
				CalculateButton.ValidationGroup="HomeEquityLoanGroup";
				NewLoanAmountCompareValidator.ValidationGroup="HomeEquityLoanGroup";
                break;
            case CalcType.Purchase:
                CalculatorTitleLiteral.Text = "Purchase";
                break;
        }

		//lblTitle.Text=CalculatorTitleLiteral.Text;
        EndorsementsAndFees.CalculatorType = CalculatorType;

        if (!Page.IsPostBack)
        {
            EstimatedClosingDateTextbox.Text = DateTime.Now.ToShortDateString();
			
			EmailIdTextbox.Attributes.Add("onblur", "SetButtonStatus('"+EmailFirstNameTextbox.ClientID +"','"+EmailIdTextbox.ClientID +"','"+SendEmailButton.ClientID +"');return false;"); 	
			
			EmailFirstNameTextbox.Attributes.Add("onblur", "SetButtonStatus('"+EmailFirstNameTextbox.ClientID +"','"+EmailIdTextbox.ClientID +"','"+SendEmailButton.ClientID +"');return false;"); 
			
			SendEmailButton.Attributes.Add("onclick", "DisableSubmit();generatePDF('"+SendEmailButton.ClientID +"','"+CalculatorTitleLiteral.Text+"','"+EmailFirstNameTextbox.ClientID +"','"+EmailLastNameTextbox.ClientID +"','"+EmailIdTextbox.ClientID +"','"+ContactPhoneNumberTextbox.ClientID +"','"+EstimatedClosingDateTextbox.ClientID +"','"+pdfblob.ClientID +"');"); 
			
        }
    }

    protected void CalculateButton_Click(object sender, EventArgs e)
    {
        DateTime estimatedClosingDate = string.IsNullOrEmpty(EstimatedClosingDateTextbox.Text) ? DateTime.MinValue : DateTime.Parse(EstimatedClosingDateTextbox.Text.Trim());
        decimal newLoanAmount = string.IsNullOrEmpty(NewLoanAmountTextbox.Text) ? 0m : decimal.Parse(NewLoanAmountTextbox.Text.Trim());
        decimal existingPayoffAmount = string.IsNullOrEmpty(ExistingPayoffAmountTextbox.Text) ? 0m : decimal.Parse(ExistingPayoffAmountTextbox.Text.Trim());
        DateTime existingLoanCloseDate = string.IsNullOrEmpty(ExistingLoanCloseDateTextbox.Text) ? DateTime.MinValue : DateTime.Parse(ExistingLoanCloseDateTextbox.Text.Trim());

        Pwoc = Calculator.PremiumWithoutCreditAndEndorsements(newLoanAmount);
        PwocValueLabel.Text = string.Format("{0:c}", Pwoc);

        decimal creditAmount = 0m;

        if (estimatedClosingDate != DateTime.MinValue && existingLoanCloseDate != DateTime.MinValue && existingPayoffAmount > 0)
            creditAmount = Calculator.CalculateCredit(existingPayoffAmount, existingLoanCloseDate, estimatedClosingDate);

        CreditValueLabel.Text = string.Format("{0:c}", creditAmount);

        CheckBoxList commonEndorsements = EndorsementsAndFees.CommonEndorsements;
        decimal commonEndorsementCost = 0m;
        foreach (ListItem item in commonEndorsements.Items)
        {
            if (item.Selected) commonEndorsementCost += EndorsementCost(item.Value);
        }

        EndorsementsValueLabel.Text = string.Format("{0:c}", commonEndorsementCost);

        decimal estimatedPremium = Pwoc + creditAmount + commonEndorsementCost;
        EstimatedPremiumValueLabel.Text = string.Format("{0:c}", estimatedPremium);

        CheckBoxList titleCompanyCharges = EndorsementsAndFees.TitleCompanyCharges;
        decimal titleCompanyCost = 0m;
        foreach (ListItem item in titleCompanyCharges.Items)
        {
            if (item.Selected) titleCompanyCost += EndorsementCost(item.Value);
        }

        TitleCoChargesValueLabel.Text = string.Format("{0:c}", titleCompanyCost);

        decimal estimatedTotalCharges = estimatedPremium + titleCompanyCost;

        EstimatedTotalValueLabel.Text = string.Format("{0:c}", estimatedTotalCharges);
		
		ShowFormButton.Visible=true;
    }

