        EmailFormPanel.Visible=true;
    }
	
	protected void SetButtonStatus(object sender, EventArgs e){
    
    }

	protected void SendEmailButton_Click(object sender, EventArgs e)
    {		
		try{
			pdfblob.Text="";
					
			string body="";
            using (SmtpClient client = new SmtpClient("relay-hosting.secureserver.net", 25))
            using (MailMessage message = new MailMessage())
            {
                string lead=String.Format("Lead: {0} {1}",this.EmailFirstNameTextbox.Text.Trim(),EmailLastNameTextbox.Text.Trim());
				string titleQuote=String.Format("sent Title Quote to: {0}",this.EmailIdTextbox.Text.Trim());
				string phone=String.Format("Phone: {0}",this.ContactPhoneNumberTextbox.Text.Trim());
				
				StringBuilder address=new StringBuilder("");
				address.Append("<div>Your Superior Texas Team</div>");
				address.Append("<div>Superior Abstract and Title</div>");
				address.Append("<div>8240 Preston Rd. Set. 250</div>");
				address.Append("<div>Plano, TX 75024</div>");
				address.Append("<div>O. 214-705-1310</div>");
				address.Append("<div><a href='#'>Texasteam3@superiorabstract.com</a></div>");
				
				body = "<div><p> "+lead+" "+titleQuote+"</p></div><div>"+phone+"</div><br/><br/><br/><br/><div>"+address.ToString()+"</div>"; 
				message.Body = body;
                message.From = new MailAddress("info@superiorabstract.com");
                message.To.Add(new MailAddress(EmailIdTextbox.Text));
				//message.Bcc.Add(new MailAddress("narikenabilli@gmail.com"));
                message.Subject = CalculatorTitleLiteral.Text+" estimate - Superior Abstract";
				message.IsBodyHtml = true; 
				
				if (pdfblob.Text!="")
				{
					byte[] bytes = Convert.FromBase64String(pdfblob.Text);
					
					System.IO.MemoryStream ms = new System.IO.MemoryStream(bytes);
					System.IO.StreamWriter writer = new System.IO.StreamWriter(ms);
						System.Net.Mime.ContentType ct = new System.Net.Mime.ContentType(System.Net.Mime.MediaTypeNames.Application.Pdf);
						System.Net.Mail.Attachment attach = new System.Net.Mail.Attachment(ms, ct);
						attach.ContentDisposition.FileName = "file.pdf";
						message.Attachments.Add(attach);
						writer.Flush();
						ms.Position = 0;

				}

				client.Send(message);

				EmailSentStatus.Text="Email Sent Successfully";
				EmailSentStatus.Visible=true;
				EmailIdTextbox.Text="";
				EmailLastNameTextbox.Text="";
				EmailFirstNameTextbox.Text="";
				ChkRequestACall.Checked=false;
				ContactPhoneNumberTextbox.Text="";
            }
		}
		catch(Exception ex){
			EmailSentStatus.Text=ex.Message;
						EmailSentStatus.Visible=true;
		}
			
     }

